import React from 'react'
const task = [
    {
        id: 1,
        text: 'Doctors Appointment',
        day: 'Feb 5th at 2:30om',
        reminder: true,
    },
    {
        id: 2,
        text: 'School',
        day: 'Feb 6th at 1:30om',
        reminder: true,
    },
    {
        id: 3,
        text: 'Food',
        day: 'Feb 5th at 2:30am',
        reminder: false,
    }
]
function Task() {
    return (
        <>
            {task.map((task) => (<h3>{task.text}</h3>))}
        </>
    )
}

export default Task
